import React from "react";


const TourScheduler = () => {

    return <div>
        <p>Is there a particular floor plan you would like to tour?</p>
        <DropdownButton id="dropdown-basic-button" title="Floor plan">
            <Dropdown.Item href="#/action-1">No, Thank you</Dropdown.Item>
            <Dropdown.Item href="#/action-2">1x1(1 bed, 1 bath)</Dropdown.Item>
            <Dropdown.Item href="#/action-3">2x2(2 bed, 2 bath)</Dropdown.Item>
            <Dropdown.Item href="#/action-3">3x3(3 bed, 3 bath)</Dropdown.Item>
            <Dropdown.Item href="#/action-3">4x4(4 bed, 4 bath)</Dropdown.Item>
        </DropdownButton>
    </div>;
};


export default TourScheduler;
